  `haschildType` int(11) DEFAULT '0',
  PRIMARY KEY (`dt_index`),
  KEY `dt_typeid` (`dt_typeid`)
) ENGINE=MyISAM AUTO_INCREMENT=138 DEFAULT CHARSET=utf8;

